const findMedianSortedArrays = `
const findMedianSortedArrays = (nums1, nums2) => {
  const merge = (xs1, xs2) => {
    if (!xs1 || !xs1.length) {
      return xs2
    }
    if (!xs2 || !xs2.length) {
      return xs1
    }
    const [hd1, ...rest1] = xs1
    const [hd2, ...rest2] = xs2
    return hd1 <= hd2 ? [hd1, ...merge(rest1, xs2)] : [hd2, ...merge(xs1, rest2)]
  }
  const nums = merge(nums1, nums2)
  const middle = Math.floor((nums.length-1) / 2)

  return (middle * 2 === (nums.length-1)) ?  nums[middle] : ((nums[middle] + nums[middle + 1]) / 2) 
}


console.log(findMedianSortedArrays([1,2],[3,4]))`.trim();

const maxSubArray = `
const maxSubArray = function (nums) {
  let max = -Infinity
  let currentMax = -Infinity
  for (let i = 0; i < nums.length; i++) {
    currentMax = Math.max(
      currentMax + nums[i],
      nums[i],
    )
    max = Math.max(max, currentMax)
  }
  return max
}

console.log(maxSubArray([-2,1,-3,4,-1,2,1,-5,4]))`.trim();

const plusOne = `
const plusOne = (digits = []) => {
  if (digits.length === 0) {
    return digits
  }
  if (digits[digits.length - 1] < 9) {
    digits[digits.length - 1] += 1
    return digits
  }
  let index = digits.length - 1
  let current = 1
  while (index >= 0) {
    const sum = current + digits[index]
    if (sum > 9) {
      digits[index] = sum - 10
      current = 1
      index -= 1
    } else {
      digits[index] = sum
      current = 0
      index -= 1
      return digits
    }
  }
  return current === 1 ? [1, ...digits] : digits
}

console.log(plusOne([1,2,3]))`.trim();

